import './App.css'
import { Routes, Route, Link } from 'react-router-dom'
import EditPhoto from './routes/EditPhoto';
import Home from './routes/Home';
import Photos from './routes/Photos';
import AddPhoto from './routes/AddPhoto';
import NotFound from './routes/NotFound';
import { image3 } from '../src/routes/index.js'

const App = () => {
  return (
    <>
      <div className='navbar'>
        <div className='studentInfo'>
          <h2 className="studentName">Ahmad Nasik</h2>
          <p className="studentId">FE2871756</p> 



        </div>
        <Link to='/'>Home</Link>
        <Link to='/photos'>My Photos</Link>
        <Link to='/add'>Add Photo</Link>
      </div>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/photos">
          <Route index element={<Photos />} />
          <Route path=":id" element={<EditPhoto />} />
        </Route>
        <Route path="/add" element={<AddPhoto />} />
        <Route path="*" element={<NotFound />} />
      </Routes>

      <input type="file" id="input-file" style="display: none;" />
          <button id="choose-image-button" className="py-2 px-4 bg-blue-500 text-white rounded-lg">
            Choose Image
        </button>
    </>
  );
};

export default App;
